import { atom } from "recoil";

interface CreditInfo {
  time: string;
}

// userInfoState의 기본값에 대한 타입 정의
const defaultCreditInfo: CreditInfo = {
  time: "",
};

export const creditInfoState = atom<CreditInfo>({
  key: "creditInfoState",
  default: defaultCreditInfo,
});
